      "description": "This layer contains pre-processed address points for the City of Alexandria, Virginia to update OpenStreetMap (OSM).<div><br /><\/div><div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font style='font-family:inherit;'><span style='font-family:inherit;'><b>Data Source<\/b><\/span><\/font><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font style='font-family:inherit;'>The address points were downloaded in May 2020 from the <a href='https://hub.arcgis.com/datasets/592958e401a844c786d35e198baa565e_0' rel='nofollow ugc' target='_blank'>ArcGIS Hub Open Data site<\/a>.<\/font><\/div><div><br /><\/div><div><div style='font-family:inherit; font-size:16px;'>There are 35,567 total address points in this layer.  Of these, 34,927 addresses are not already represented as points in OSM and can be added to OSM.<\/div><div style='font-family:inherit; font-size:16px;'><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'><br /><\/span><\/div><div style='font-family:inherit; font-size:16px;'><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'>Features with an Import_2_OSM value of 1 (i.e. <\/span><font color='#000000' style='font-family:inherit;'><b>Import <\/b><\/font><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'>features, shown in <\/span><font color='#008000' style='font-family:inherit;'><b>Green<\/b><\/font><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'>) have no conflict and can be added to OSM.  Features with an Import_2_OSM value of 2 (i.e. <\/span><b><font color='#000000' style='font-family:inherit;'>No Import<\/font><\/b><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'> features, shown in <\/span><font color='#8b0000' style='font-family:inherit;'><b>Red<\/b><\/font><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'>) conflict with existing addresses and should not be added.  The layer is currently configured to only display the features that <\/span><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'>have no conflict and can be added to OSM.<\/span><\/div><\/div><\/div><div style='font-family:inherit; font-size:16px;'><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'><br /><\/span><\/div><div style='font-family:inherit; font-size:16px;'><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'><b>OSM Editor Tools<\/b><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'><font style='font-family:inherit;'>This layer is accessible through <\/font><a href='https://www.esriurl.com/ArcGIS4OSM' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>new tools in OSM editors<\/b><\/a><font style='font-family:inherit;'> (e.g. <\/font><a href='https://mapwith.ai/rapid' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>updated version of RapiD<\/b><\/a><font style='font-family:inherit;'>) that enable OSM mappers to display the features on a map, select an individual feature to inspect its geometry and tags, and then use the feature for editing.  OSM mappers should review the individual features and tags, and make any edits and additions that are appropriate, before selecting other features to edit and uploading edits to OSM.<\/font><\/div><\/div>",
