      "description": "<span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This layer contains pre-processed building footprints for the <\/span><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>City of Riverside, California<\/span><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'> to be added to OpenStreetMap. <\/span><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>The data has been provided by the City of Riverside and pre-processed by Esri for the explicit purpose of contributing to OpenStreetMap.<\/span><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font style='font-family:inherit;'><span style='font-family:inherit;'><b><br /><\/b><\/span><\/font><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font size='4' style='font-family:inherit;'><b>Data Source<\/b><\/font><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>The building footprints were originally generated by Microsoft as part of the California file downloaded from the <a href='https://github.com/Microsoft/USBuildingFootprints' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'>Microsoft Buildings repo on GitHub<\/a>. (This was the second release of building footprints. Microsoft had made a <a href='https://wiki.openstreetmap.org/wiki/Microsoft_Building_Footprint_Data' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'>prior release of building footprints<\/a> that did not include Riverside County.) These footprints were generated based on Bing aerials from 2014-2015. The Building Footprints from the City of Riverside generated in 2012 replaced the Microsoft footprints where they overlapped. Attributes were added by the City Transportation Department that include FIPS information, fields from the City of Riverside schema, Address IDs from the ADDRESS_POINTS feature class, Building centroid coordinates and APNs.<font style='font-family:inherit;'><span style='font-family:inherit;'><br /><\/span><\/font><div><font style='font-family:inherit;'><br /><\/font><\/div><div><b>Update Plan<\/b>:<font style='font-family:inherit;'><span style='font-family:inherit;'><br /><\/span><\/font><div style='font-family:inherit;'><span style='font-family:inherit;'>This layer contains 152,588 buildings for the City of Riverside. 144,438 of the building features do not currently exist in OSM (as of Apr 16) and will be imported (Import_2_OSM value of 1)<\/span><span style='font-family:inherit;'>.  The remaining 8,150 conflict with existing buildings in OSM and will not be imported (<\/span><span style='font-family:inherit;'>Import_2_OSM value of 0).<\/span><br /><\/div><div style='font-family:inherit;'><br /><\/div><div style='font-family:inherit;'>Features with an Import_2_OSM value of 1 (i.e. <font color='#008000' style='font-family:inherit;'><b>Import <\/b><\/font>features, shown in <font color='#008000' style='font-family:inherit;'><b>Green<\/b><\/font>) have no conflict and can be added to OSM.  Features with an Import_2_OSM value of 0 (i.e. <b><font color='#8b0000' style='font-family:inherit;'>No Import<\/font><\/b> features, shown in <font color='#8b0000' style='font-family:inherit;'><b>Red<\/b><\/font>) conflict with existing buildings and will not be added.<\/div><div style='font-family:inherit;'><br /><\/div><div style='font-family:inherit;'><div style='font-family:inherit;'><b>Other fields<\/b><\/div><div style='font-family:inherit;'><ul><li>building, name, height, levels, addr_* - all  map to OSM defined import fields<\/li><li>BlockGroup - Census FIPS used to select (252) smaller subsets for import processing<\/li><\/ul><div><div><b>OSM Editor Tools<\/b><\/div><div><font style='font-family:inherit;'>This layer is accessible through <\/font><a href='https://www.esriurl.com/ArcGIS4OSM' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>new tools in OSM editors<\/b><\/a><font style='font-family:inherit;'> (e.g. <\/font><a href='https://mapwith.ai/rapid' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>updated version of RapiD<\/b><\/a><font style='font-family:inherit;'>) that enable OSM mappers to display the features on a map, select an individual feature to inspect its geometry and tags, and then use the feature for editing.  OSM mappers should review the individual features and tags, and make any edits and additions that are appropriate, before selecting other features to edit and uploading edits to OSM.<\/font><\/div><\/div><\/div><\/div><\/div><\/div>",
