      "description": "<span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This layer features roads and highways provided by Esri Community Maps contributors that has been prepared for use in OpenStreetMap.  <\/span><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This sample layer is being <b>shared for testing only<\/b>.  <\/span><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This is a sample dataset with roads data for a few communities in the United States, including:<\/span><div><ul><li><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>City of Eloy, AZ<\/span><\/li><li><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>Yavapai County, AZ (including Prescott, AZ)<\/span><\/li><li><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>Lehigh County, PA (including Allentown, PA)<\/span><\/li><\/ul><div><font face='Avenir Next W01, Avenir Next W00, Avenir Next, Avenir, Helvetica Neue, sans-serif'><span style='font-size:16px;'>The dataset includes a few OSM tags that can be used for editing, including highway, name, addr:street, addr:city, addr:state, addr:postcode, and source.<\/span><\/font><\/div><\/div><div><font face='Avenir Next W01, Avenir Next W00, Avenir Next, Avenir, Helvetica Neue, sans-serif'><span style='font-size:16px;'><br /><\/span><\/font><\/div><div><font face='Avenir Next W01, Avenir Next W00, Avenir Next, Avenir, Helvetica Neue, sans-serif'><span style='font-size:16px;'>The dataset has been pre-conflated with existing OSM roads data to determine which roads are likely to already exist in OSM as of mid-March 2022.  The roads that do not have a spatial conflict with existing OSM roads have been flagged (i.e. Import2OSM = 1 or &quot;No Conflict&quot;).<\/span><\/font><\/div>",
