      "description": "<font style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This layer contains pre-processed <b>building footprints for Prince George's County and Montgomery County, Maryland<\/b>.  This data was shared by the Maryland-National Capital Park and Planning Commission (MNCPPC) as open data through the <a href='https://communitymaps.arcgis.com/' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>Esri Community Maps<\/b><\/a> program and its <a href='https://www.esri.com/arcgis-blog/products/arcgis-living-atlas/mapping/community-maps-data-sharing/' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>new option for data sharing<\/b><\/a>.<\/font><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font size='3' style='font-family:inherit;'><br /><\/font><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font size='3' style='font-family:inherit;'><div style='font-family:inherit; font-size:16px;'>This layer contains <b>650,616 buildings<\/b> for the Counties, most of which do not already existing as building features in OpenStreetMap (OSM).  The buildings for the Counties include a couple fields (building, addr:state) that have been prepared to be added as tags in OSM.  The building field includes unique values for 7,996 buildings (with 'yes' values for the remainder).<\/div><div style='font-family:inherit; font-size:16px;'><br /><\/div><div style='font-family:inherit;'><font style='font-family:inherit;'>The processed building footprints referenced above were created using these <\/font><a href='https://openstreetmap.maps.arcgis.com/home/item.html?id=7e57d46df82e453480a0cb81f1f27901' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>Esri Data Processing Steps for Buildings and Addresses<\/b><\/a><font style='font-family:inherit;'>, developed and refined while doing data prep for several city and county communities in the United States.<\/font><\/div><div style='font-family:inherit;'><font style='font-family:inherit;'><br /><\/font><\/div><div style='font-family:inherit;'><font style='font-family:inherit;'><div style='font-size:16px;'><b>OSM Editor Tools<\/b><\/div><div style='font-size:16px;'><font style='font-family:inherit;'>This layer is accessible through <\/font><a href='https://www.esriurl.com/ArcGIS4OSM' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>new tools in OSM editors<\/b><\/a><font style='font-family:inherit;'> (e.g. <\/font><a href='https://mapwith.ai/rapid' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>updated version of RapiD<\/b><\/a><font style='font-family:inherit;'>) that enable OSM mappers to display the features on a map, select an individual feature to inspect its geometry and tags, and then use the feature for editing.  OSM mappers should review the individual features and tags, and make any edits and additions that are appropriate, before selecting other features to edit and uploading edits to OSM.<\/font><\/div><\/font><\/div><\/font><\/div>",
