      "type": "Feature Service",
      "description": "<span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This layer contains pre-processed address points for Richland County, North Dakota that can be added to OpenStreetMap.<\/span><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><br /><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif;'><div style='font-size:16px;'><div style='font-family:inherit;'><font style='font-family:inherit;'><span style='font-family:inherit;'><b>Data Source<\/b><\/span><\/font><\/div><div style='font-family:inherit;'><font style='font-family:inherit;'>The address points were downloaded in June 2020 from the <a href='https://hub.arcgis.com/datasets/7cd06c9762c84206bf4d721c58ae0ab7_362' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'>ArcGIS Hub Open Data site<\/a>.<\/font><\/div><\/div><div style='font-size:16px;'><br /><\/div><div><div style='font-size:16px; font-family:inherit;'><span style='font-family:inherit;'>There are 7,608<\/span><span style='font-family:inherit;'> total address points.  Of these, <\/span>7,588 addresses are not already represented as points in OSM and can be added<span style='font-family:inherit;'>.  <\/span><span style='font-family:inherit;'>Features where Import_2_OSM = 1 can be added to OpenStreetMap.<\/span><\/div><ul><li><span style='font-family:inherit; font-weight:bold;'><font size='3'>1 -  no OSM conflict, and can be added<\/font><\/span><\/li><li><font size='3'>2 - address point already exists in OSM and should not be added<\/font><\/li><li><font size='3'>4 - point has no street address number and should not be added to OSM<\/font><br /><\/li><\/ul><div style='font-size:16px; font-family:inherit;'>Features with an Import_2_OSM value of 1 (i.e. <font color='#000000' style='font-family:inherit;'><b>Import <\/b><\/font>features, shown in <font color='#008000' style='font-family:inherit;'><b>Green<\/b><\/font>) have no conflict and can be added to OSM.  Features with an Import_2_OSM value of 2 (i.e. <b><font color='#000000' style='font-family:inherit;'>No Import<\/font><\/b> features, shown in <font color='#8b0000' style='font-family:inherit;'><b>Red<\/b><\/font>) conflict with existing addresses and should not be added. The layer is currently configured to only display the features that have no conflict and can be added to OSM.<\/div><div style='font-size:16px; font-family:inherit;'><br /><\/div><div style='font-size:16px; font-family:inherit;'><div><b>OSM Editor Tools<\/b><\/div><div><font style='font-family:inherit;'>This layer is accessible through <\/font><a href='https://www.esriurl.com/ArcGIS4OSM' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>new tools in OSM editors<\/b><\/a><font style='font-family:inherit;'> (e.g. <\/font><a href='https://mapwith.ai/rapid' rel='nofollow ugc' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank'><b>updated version of RapiD<\/b><\/a><font style='font-family:inherit;'>) that enable OSM mappers to display the features on a map, select an individual feature to inspect its geometry and tags, and then use the feature for editing.  OSM mappers should review the individual features and tags, and make any edits and additions that are appropriate, before selecting other features to edit and uploading edits to OSM.<\/font><\/div><\/div><\/div><\/div>",
