      "description": "<div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This layer contains pre-processed <b>building footprints<\/b> for the State of Vermont. The data has been provided by the <a href='https://vcgi.vermont.gov/' target='_blank' rel='nofollow ugc noopener noreferrer'>Vermont Center for Geographic Information<\/a> (VCGI) and pre-processed by Esri for the purpose of contributing to OpenStreetMap (OSM).<\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><br /><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><b>Data source<\/b>: <a href='https://geodata.vermont.gov/datasets/vt-data-e911-footprints-1/explore' target='_blank' rel='nofollow ugc noopener noreferrer'>VT Open Geodata Portal<\/a><br /><div style='font-family:inherit;'><span style='font-family:inherit;'><br /><\/span><\/div><span style='font-family:inherit;'>There are <b>411,011 building footprints<\/b> in this layer, many of which already exist in OSM.  Most of the building footprints contain <b>address information<\/b>.  The building footprints can be added to OSM where buildings do not already exist.  If buildings already exist but are missing address information, OSM mappers may also want to use the <\/span><a href='https://www.arcgis.com/home/item.html?id=1f8e9e4ef35c4c3fa759124d65852c6e' target='_blank' rel='nofollow ugc noopener noreferrer'>State of Vermont Addresses layer<\/a><span style='font-family:inherit;'> to add address tags to those buildings.<\/span><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><span style='font-family:inherit;'><br /><\/span><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><div><b>OSM Editor Tools<\/b><\/div><div><font style='font-family:inherit;'>This layer is accessible through <\/font><a href='https://www.esriurl.com/ArcGIS4OSM' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank' rel='nofollow ugc noopener noreferrer'><b>new tools in OSM editors<\/b><\/a><font style='font-family:inherit;'> (e.g. <\/font><a href='https://mapwith.ai/rapid' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank' rel='nofollow ugc noopener noreferrer'><b>updated version of RapiD<\/b><\/a><font style='font-family:inherit;'>) that enable OSM mappers to display the features on a map, select an individual feature to inspect its geometry and tags, and then use the feature for editing.  OSM mappers should review the individual features and tags, and make any edits and additions that are appropriate, before selecting other features to edit and uploading edits to OSM.<\/font><\/div><\/div>",
