      "description": "<div><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>This layer contains address points for several U.S. states from the U.S. Department of Transportation <\/span><a href='https://www.transportation.gov/gis/national-address-database/national-address-database-0' target='_blank' rel='nofollow ugc noopener noreferrer'>National Address Database<\/a><span style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'>, which have been <b>processed for use in editing OpenStreetMap<\/b> (OSM).<\/span><br /><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><br /><\/div><div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font style='font-family:inherit;'><span style='font-family:inherit;'><b>Data Source<\/b><\/span><\/font><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font style='font-family:inherit;'>The address points were originally downloaded in January 2021 from the <a href='https://www.transportation.gov/gis/national-address-database/national-address-database-0' target='_blank' rel='nofollow ugc noopener noreferrer'>U.S. Department of Transportation website<\/a> and subsequently updated with a more recent version downloaded in June 2021, which contained a few million more records.  This layer has now been updated with a <b>more recent release (r14)<\/b> downloaded and processed in August and September 2023.<\/font><\/div><div style='font-family:inherit; font-size:16px;'><br /><\/div><div><div style='font-family:inherit; font-size:16px;'>There are currently <b>75,937,418 total address points<\/b> in this layer, compiled from several dozen local sources.  The source data was processed by Esri to have a common set of OpenStreetMap address (<a href='https://wiki.openstreetmap.org/wiki/Key:addr' target='_blank' rel='nofollow ugc noopener noreferrer'>addr<\/a>) keys (e.g. housenumber, street, unit, city, state) and values so that it can be more easily added to OpenStreetMap where appropriate by mappers.  Many of these address points may already exist in OpenStreetMap, either as tags on building features or separate address points, and should therefore not be added again.<\/div><div style='font-family:inherit; font-size:16px;'><br /><\/div><div style='font-family:inherit; font-size:16px;'><b>National Address Database<\/b><\/div><div><font><span style='font-size:16px;'>The U.S. Department of Transportation (USDOT) and its partners from all levels of government recognize the need for a National Address Database (NAD).  Accurate and up-to-date addresses are critical to transportation safety and are a vital part of Next Generation 9-1-1. They are also essential for a broad range of government services, including mail delivery, permitting, and school siting.  <\/span><\/font><span style='font-size:16px;'>To meet this need, USDOT partners with address programs from state, local, and tribal governments to compile their authoritative data into the NAD.<\/span><br /><\/div><\/div><\/div><div><span style='font-size:16px;'><br /><\/span><\/div><div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><b>OSM Editor Tools<\/b><\/div><div style='font-family:&quot;Avenir Next W01&quot;, &quot;Avenir Next W00&quot;, &quot;Avenir Next&quot;, Avenir, &quot;Helvetica Neue&quot;, sans-serif; font-size:16px;'><font style='font-family:inherit;'>This layer is accessible through <\/font><a href='https://www.esriurl.com/ArcGIS4OSM' style='color:rgb(0, 121, 193); text-decoration-line:none; font-family:inherit;' target='_blank' rel='nofollow ugc noopener noreferrer'><b>new tools in OSM editors<\/b><\/a><font style='font-family:inherit;'> (e.g. <\/font><font style='font-family:inherit;'><a href='https://rapideditor.org/edit' target='_blank' rel='nofollow ugc noopener noreferrer'><b>updated version of Rapid<\/b><\/a>) that enable OSM mappers to display the features on a map, select an individual feature to inspect its geometry and tags, and then use the feature for editing.  OSM mappers should review the individual features and tags, and make any edits and additions that are appropriate, before selecting other features to edit and uploading edits to OSM.<\/font><\/div><\/div>",
